        "vaeua-gui-eua.CalculatedItemUIMediator.scopes.scopedAggregation.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Le misure aggregate possono avere molteplici ambiti. Ogni ambito contiene un’espressione e un’intersezione di categorie specificata, che determinano dove sono visualizzati i risultati dell’espressione in un oggetto.</p><p class\\="xis-paragraph">Un ambito di default contiene l’espressione di base i cui risultati sono visualizzati per qualsiasi intersezione che non è specificata in altri ambiti creati dall’utente. L’ambito di questa espressione di base non può essere modificato o eliminato.</p><p class\\="xis-paragraph">Oltre all’ambito di default dell’espressione di base, è possibile creare ambiti personalizzati che possono essere modificati ed eliminati.</p></section>',
