        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">L’insight <span class\\="xis-windowItem">Outlier</span> identifica gli elementi di dati nel report che potrebbero essere influenzati da outlier. </p><p class\\="xis-paragraph">Per visualizzare un’analisi degli outlier per una misura, fare clic su <span data-icon-name\\="information" alt\\="Icona Informazioni" aria-label\\="Icona Informazioni"></span> accanto alla misura e quindi fare clic su <span class\\="xis-windowItem">Visualizza analisi degli outlier</span> nella finestra popup.</p><p class\\="xis-paragraph">Per visualizzare gli effetti degli outlier sugli oggetti nel report, fare clic su <span class\\="xis-windowItem">Analizza oggetti per impatto</span>. Al termine dell’analisi, fare clic su <span class\\="xis-windowItem">Dettagli</span> accanto al nome di un oggetto per visualizzare un’analisi dettagliata degli outlier in tale oggetto.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span>L’insight <span class\\="xis-windowItem">Outlier</span> identifica tutti gli outlier nelle origini dati, anche se gli oggetti del report escludono i valori utilizzando filtri o classificazioni in ranghi.</div></section>',
