        "vaeua-gui-eua.sas.van.ReportReview.HighDataObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ridurre il numero di oggetti per eliminare i seguenti problemi. Per esempio, per eliminare problemi con priorità media, ridurre il numero di oggetti nel report a 12 o meno.</p><p class\\="xis-paragraph">Priorità bassa\\: contiene &gt; 7 oggetti sulla pagina</p><p class\\="xis-paragraph">Priorità media\\: contiene &gt; 12 oggetti sulla pagina</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.svm.missingvalue.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il valore iniziale (di default) per il controllo. Il valore iniziale viene selezionato la prima volta in cui un utente apre il report o quando un utente seleziona <span class\\="xis-windowItem">Ripristina stato di default del report</span>. </p><div class\\="xis-paragraph">Immettere un valore nel campo di testo o specificare uno dei seguenti valori\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatico</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che la selezione viene salvata come valore iniziale quando si salva il report. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valore minimo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> specifica che il valore più piccolo nel controllo è il valore iniziale.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valore massimo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> specifica che il valore più grande nel controllo è il valore iniziale.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">nome-parametro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che il valore del parametro che si seleziona è il valore iniziale per il controllo.</p><p class\\="xis-paraSimple">È possibile selezionare un parametro soltanto se esiste già un parametro con il tipo di dati appropriato.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.includeMissing.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Ordine di connessione</span> specifica come collegare i punti di dati in modo da formare le linee del diagramma. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Asse</span></td><td>collega tutti i punti di dati da sinistra a destra sull’asse X.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Dati</span></td><td>collega i punti di dati nell’ordine in cui vengono letti dal ruolo X.</td></tr></table></div>                 </div><p class\\="xis-paragraph">È possibile utilizzare questo valore per garantire una connessione ordinata quando i dati di input non sono ordinati per il ruolo X.</p></section>',
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero massimo di vettori di supporto. Il numero reale di vettori di supporto potrebbe essere leggermente più alto di quello specificato a causa della natura del metodo active-set.</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.logisticRegression.gConvValue.help.tip.txt": "Maggiori informazioni su questa opzione ",
