        "vaeua-gui-eua.groupingScale.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.svm.missingvalue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Estende il modello per includere osservazioni con valori mancanti e includere valori mancanti nella variabile di risposta. I predittori categorici trattano un valore mancante come valore separato. Un predittore continuo sostituisce un valore mancante con la media del predittore.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.maximumSeconds.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa il tempo massimo di default per il training della rete neurale. Il valore di default è 270. </p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.resolution.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.yAxisTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Visualizzazione del valore della tacca</span> specifica il metodo usato per disporre i valori delle tacche di riferimento sull’asse Y. È possibile specificare quanto segue\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Rimuovi alcuni</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">rimuove alcuni valori delle tacche di riferimento.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Mostra tutti</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">visualizza tutti i valori delle tacche di riferimento.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.missingAssignment.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.svm.maxSupportVectors.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.control.initialMinValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il valore minimo iniziale (limite inferiore) per il controllo. Il valore iniziale viene selezionato la prima volta in cui un utente apre il report o quando un utente seleziona <span class\\="xis-windowItem">Ripristina stato di default del report</span>. </p><div class\\="xis-paragraph">Immettere un valore nel campo di testo o specificare uno dei seguenti valori\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatico</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che la selezione viene salvata come valore iniziale quando si salva il report. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valore minimo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> specifica che il valore più piccolo nel controllo è il valore iniziale.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">nome-parametro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che il valore del parametro che si seleziona è il valore iniziale per il controllo.</p><p class\\="xis-paraSimple">È possibile selezionare un parametro soltanto se esiste già un parametro con il tipo di dati appropriato.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.analyzeSentiment.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Analizza il sentiment di ogni documento in base all’utilizzo di termini positivi e negativi.</p></section>',
