        "vaeua-gui-eua.sas.van.control.initialMinValue.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.Insights.outliers.help.aria.txt": "Guida. Maggiori informazioni sugli insight",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useStopList.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.pcPlot.maxPolylines.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero massimo di polilinee che possono essere generate dall’algoritmo delle coordinate parallele. L’aumento di questo valore permette un raggruppamento maggiormente dettagliato.</p></section>',
        "vaeua-gui-eua.Properties.assessment.numberOfBinsCategory.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.lasso.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Visualizzazione del valore della tacca</span> specifica il metodo usato per disporre i valori delle tacche di riferimento sull’asse X. È possibile selezionare <span class\\="xis-windowItem">Riduci automaticamente la sovrapposizione</span> oppure <span class\\="xis-windowItem">Orientamento fisso</span>.</p><div class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Riduci automaticamente la sovrapposizione</span> viene applicata soltanto quando i valori delle tacche si sovrappongono. È possibile specificare quanto segue\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Rimuovi alcuni</span></td><td>rimuove alcuni valori delle tacche di riferimento.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Ruota di 45°</span></td><td>ruota tutti i valori delle tacche di 45° in diagonale.</td></tr></table></div>                 </div><div class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Orientamento fisso</span> viene applicata sempre e imposta l’orientamento dei valori. È possibile specificare quanto segue\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">Orizzontale</span></td><td>visualizza i valori delle tacche orizzontalmente.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Ruota di 45°</span></td><td>ruota tutti i valori delle tacche di 45° in diagonale.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">Ruota di 45°, rimuovi</span></td><td>ruota tutti i valori delle tacche di 45° in diagonale e quindi rimuove valori delle tacche.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.interactionEffect.complete.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Estende il modello per includere osservazioni con valori mancanti. Un effetto continuo è imputato con la media osservata e viene creata una variabile indicatore che denota dati mancanti. Un effetto categorico tratta i valori mancanti come livello distinto. </p></section>',
