        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Mostra le categorie più consigliate o meno consigliate per ogni variabile categorica. Occorre assegnare almeno un predittore prima di poter scegliere un predittore.</p></section>',
