        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.cluster.color.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
