        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.splittingCriterion.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero di cluster da creare o specifica che si dovrebbe utilizzare il metodo Aligned Box Criterion (ABC) per derivare un numero ottimale di cluster.</p><p class\\="xis-paragraph">Il metodo ABC sceglie innanzi tutto un certo numero di cluster da creare, li crea e calcola la statistica gap per ciascun cluster. Successivamente, viene creata una distribuzione di riferimento orientata attorno a ciascun cluster e viene calcolata la statistica gap per ciascuna distribuzione di riferimento. Questo processo è ripetuto per tutto il numero potenziale di cluster. Il numero di cluster che massimizza la differenza totale tra le statistiche gap dei cluster e i dati di riferimento viene scelto come numero ottimale di cluster.</p><p class\\="xis-paragraph">Il metodo ABC è valido soltanto quando tutti gli input sono variabili di misura.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Usa il numero di default di predittori da provare per ogni suddivisione. Il valore di default è la radice quadrata del numero totale di predittori. Altrimenti, specificare il numero di predittori da provare per ogni suddivisione.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero di raggruppamenti da utilizzare per classificare le variabili di misura nel diagramma Dipendenza parziale.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Abilita l’algoritmo di clusterizzazione rapida delle k-medie e ignora l’ordinamento dei raggruppamenti. Non selezionare questa opzione se si desidera usare l’algoritmo di ricerca greedy e rispettare l’ordinamento dei raggruppamenti. Le risposte di misura senza raggruppamento utilizzano la varianza come criterio di selezione. Quando questa opzione è selezionata, le risposte categoriche e le risposte di misura raggruppate utilizzano il criterio del gain informativo. Altrimenti viene utilizzato il gain assoluto.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.barSpacing.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Cerca di creare una rete bayesiana naïve e una rete bayesiana augmented naïve. Una rete bayesiana naïve specifica che la variabile di risposta è l’unico padre per tutti i predittori. Assume l’indipendenza condizionale di tutti i predittori, data la variabile di risposta. Una rete bayesiana augmented naïve estende la rete bayesiana naïve permettendo ai nodi predittore di formare una rete bayesiana.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
