        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero relativo di community (raggruppamenti di nodi locali) da calcolare. Le community vengono aggiornate dinamicamente quando la rete cambia.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Forza fattori non negativi con termini di distorsione a essere impostati a zero. Ciò può migliorare le performance quando i dati di training sono molto sparsi.</p></section>',
