        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il livello di personalizzazione che ogni utente può applicare alla visualizzazione del report. Ogni livello include i livelli sottostanti.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Genera tag personalizzati HTML in modo che l’oggetto o il report possano essere incorporati in una pagina Web.</p><p class\\="xis-paragraph">Per abilitare i tag personalizzati nella pagina Web, occorre inoltre aggiungere tag &lt;script&gt; all’intestazione della pagina. Per maggiori informazioni su come incorporare contenuto di SAS Visual Analytics, consultare la <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">documentazione di SAS Visual Analytics SDK</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Spaziatura dei cluster</span> controlla la larghezza della spaziatura tra i cluster per le barre raggruppate. Se si desidera cambiare lo spazio tra le barre, specificare l’opzione <span class\\="xis-windowItem">Spaziatura</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Il tipo di gruppo <span class\\="xis-windowItem">Valori distinti</span> è disponibile soltanto per misure che hanno un numero minore di valori univoci.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero di raggruppamenti che sono utilizzati per categorizzare una risposta di misura.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Fa crescere l’albero decisionale utilizzando i dati di training ed esegue il pruning dell’albero decisionale utilizzando un algoritmo di complessità del costo applicato ai dati di validazione.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.generalizedAdditive.modelEvaluationCriterion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il criterio per la selezione dei parametri di smoothing degli effetti spline.</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Costruisce le strutture di rete specificate, iterando sul numero di padri da 1 al valore del numero massimo di padri. Viene selezionata la rete con il migliore errore di classificazione.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.binMethod.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
