        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il grado di sensitività utilizzato per identificare i valori estremi. Un’impostazione di sensitività più elevata in genere identifica più valori come estremi.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
