        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica che gli utenti bypassano la schermata di accesso e utilizzano automaticamente le credenziali Guest. Nel caso di utenti con credenziali Guest, lo stato della visualizzazione non viene mantenuto tra le sessioni e le preferenze utente non sono disponibili.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica la profondità massima dell’albero, in cui il nodo principale è il livello 1.</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.max.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.barLabelFitPolicy.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.learning_rate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il tasso di apprendimento. Un apprendimento più lento può evitare l’overfitting del modello.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterTwo.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il valore massimo iniziale (limite superiore) per il controllo. Il valore iniziale viene selezionato la prima volta in cui un utente apre il report o quando un utente seleziona <span class\\="xis-windowItem">Ripristina stato di default del report</span>. </p><div class\\="xis-paragraph">Immettere un valore nel campo di testo o specificare uno dei seguenti valori\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatico</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che la selezione viene salvata come valore iniziale quando si salva il report. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valore massimo</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che il valore più grande nel controllo è il valore iniziale.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">nome-parametro</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">specifica che il valore del parametro che si seleziona è il valore iniziale per il controllo.</p><p class\\="xis-paraSimple">È possibile selezionare un parametro soltanto se esiste già un parametro con il tipo di dati appropriato.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Specifica come viene utilizzato il traffico per calcolare il tempo di percorrenza per la funzionalità grafica. Selezionare una delle seguenti opzioni\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">No</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Specifica che il calcolo del tempo di percorrenza utilizza una media pesata dei dati storici sul traffico per tutte le ore del giorno e per tutti i giorni della settimana.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Traffico corrente</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Specifica che il calcolo del tempo di percorrenza utilizza le condizioni di traffico correnti. Questi dati sul traffico possono essere aggiornati facendo clic su <span data-icon-name\\="refresh" alt\\="Icona Aggiorna i dati sul traffico" aria-label\\="Icona Aggiorna i dati sul traffico"></span>. Quando un utente visualizza il report, il traffico non viene aggiornato automaticamente. L’utente deve aggiornare i dati sul traffico in modo da riflettere le condizioni di traffico più recenti.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Traffico tipico</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> specifica che il calcolo del tempo di percorrenza utilizza il traffico tipico per l’ora e il giorno della settimana specificati. Le condizioni tipiche di traffico si basano sui dati storici recenti.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span> L’ora specificata è l’ora locale per la posizione sulla mappa.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span>Il recupero dei dati sul tempo di percorrenza consuma crediti dei servizi Esri Premium.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Nota\\:</span>Se non sono disponibili dati sul traffico per l’area che contiene il calcolo del tempo di percorrenza, per calcolare il tempo di percorrenza vengono utilizzati i limiti di velocità pubblicati.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruning.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.interactionEffect.twoWay.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Effetti composti da ogni coppia di elementi selezionati. Questo effetto richiede almeno due elementi.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Selezionare la variabile da utilizzare per suddividere il nodo. Le variabili sono ordinate in base al logworth, che misura la bontà con cui tale variabile divide i dati. Il logworth è il logaritmo negativo del p-value dal test del chi-quadrato.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Mostra la panoramica degli assi.</p><p class\\="xis-paragraph">Questa opzione non è disponibile se sono assegnati più di due elementi di dati al diagramma.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.networkStructure.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.predAuto.numGroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero di gruppi da riportare nei risultati. Di default, vengono riportati i primi tre e gli ultimi tre gruppi.</p></section>',
