        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica l’errore di validazione massimo accettabile per completare il training del modello. Quando l’errore di validazione è minore del valore obiettivo specificato, il training del modello ha termine.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "Maggiori informazioni su questa opzione ",
