        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica la funzione di distribuzione utilizzata per modellizzare la variabile di risposta.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Rotazione dello stile dell’elemento di dati</span> specifica come vengono assegnati gli stili agli elementi di dati nel template dei grafici. In un grafico a linee, per esempio, questa opzione specifica come vengono usati colori, pattern a linea e indicatori per distinguere le linee nel grafico. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatico</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">utilizza l’impostazione di rotazione dello stile dal tema. La maggior parte dei temi SAS utilizza l’impostazione <span class\\="xis-windowItem">Ruota prima tutti i colori</span>. Il tema High Contrast utilizza l’impostazione <span class\\="xis-windowItem">Ruota tutti gli attributi</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Ruota prima tutti i colori</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">visualizza una tinta unita, una linea continua e una forma dell’indicatore coerente fino a quando non vengono usati tutti i colori della tavolozza.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Ruota tutti gli attributi</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">visualizza pattern di riempimento, pattern a linea e forme dell’indicatore oltre a colori diversi. Questa impostazione può migliorare l’accessibilità per gli utenti con deficit visivo relativo ai colori (daltonismo).</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "Guida. Maggiori informazioni su questa opzione ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il parametro di scala (coefficiente) nella funzione sigmoidea.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica il numero di community (raggruppamenti di nodi locali) da calcolare all’interno di ciascun cluster di nodi. Si osservi che il numero totale di community calcolate potrebbe essere minore del valore selezionato, a seconda della struttura e della dimensione della rete.</p></section>',
