        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">I predittori categorici trattano un valore mancante come valore separato. Un predittore continuo sostituisce un valore mancante con la media del predittore. Per le reti bayesiane, i valori mancanti non sono inclusi nella variabile di risposta.</p></section>',
