        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">L’opzione <span class\\="xis-windowItem">Scala di raggruppamento</span> determina come scalare i grafici a barre raggruppate. Le barre possono essere in pila o in cluster. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valori effettivi</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">dimensiona le barre in base ai valori presenti nei dati. Per esempio, si supponga che una barra in un gruppo abbia un valore pari a 50 e una barra in un altro gruppo abbia un valore pari a 500. La barra con valore 500 sarebbe 10 volte più alta della barra con valore 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Normalizza gruppi al 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">presenta i gruppi utilizzando una scala relativa. All’interno di un gruppo, ciascuna barra viene visualizzata come percentuale del gruppo. Per esempio, si supponga che un gruppo abbia un valore totale pari a 100. Se una barra all’interno di tale gruppo ha un valore pari a 50, la barra rappresenta il 50% dell’altezza del gruppo complessivo.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">Questa opzione non è disponibile quando l’oggetto grafico contiene elementi grafici sovrapposti. L’opzione non è disponibile anche quando si specifica lo stesso range dei dati per gli assi in un reticolo.</p></section>',
