        "vaeua-gui-eua.Properties.predAuto.showGroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Specifica se tutti i gruppi sono riportati nei risultati. Di default, vengono riportati soltanto i primi tre e gli ultimi tre gruppi. Se questa opzione è selezionata, sia la scheda <span class\\="xis-windowItem">Alti</span> che la scheda <span class\\="xis-windowItem">Bassi</span> visualizzano tutti i gruppi, ma i gruppi sono ordinati in modo diverso. Per le risposte di misura, i gruppi nella scheda <span class\\="xis-windowItem">Alti</span> sono ordinati dal valore medio più alto a quello più basso e quelli nella scheda <span class\\="xis-windowItem">Bassi</span> sono ordinati dal valore medio più basso a quello più alto. Per le risposte categoriche, i gruppi nella scheda <span class\\="xis-windowItem">Alti</span> sono ordinati dalla percentuale più alta a quella più bassa del livello dell’evento selezionato e quelli nella scheda <span class\\="xis-windowItem">Bassi</span> sono ordinati dalla percentuale più bassa a quella più alta del livello dell’evento selezionato.</p></section>',
